import { createRouter, createWebHistory } from 'vue-router'

const routes = [
  {
    path: '/',
    name: 'Home',
    component: () => import('../views/Home.vue')
  },
  {
    path: '/products',
    name: 'Products',
    component: () => import('../views/Products.vue'),
    children: [
      {
        path: 'platform/:id',
        name: 'Platform',
        component: () => import('../views/products/Platform.vue')
      },
      {
        path: 'system/:id',
        name: 'System',
        component: () => import('../views/products/System.vue')
      },
      {
        path: 'support/:id',
        name: 'Support',
        component: () => import('../views/products/Support.vue')
      }
    ]
  },
  {
    path: '/applications',
    name: 'Applications',
    component: () => import('../views/Applications.vue'),
    children: [
      {
        path: 'defense',
        name: 'DefenseApplication',
        component: () => import('../views/applications/Defense.vue')
      },
      {
        path: 'energy',
        name: 'EnergyApplication',
        component: () => import('../views/applications/Energy.vue')
      },
      {
        path: 'marine',
        name: 'MarineApplication',
        component: () => import('../views/applications/Marine.vue')
      },
      {
        path: 'public-safety',
        name: 'PublicSafetyApplication',
        component: () => import('../views/applications/PublicSafety.vue')
      },
      {
        path: 'surveying',
        name: 'SurveyingApplication',
        component: () => import('../views/applications/Surveying.vue')
      },
      {
        path: 'integration',
        name: 'IntegrationApplication',
        component: () => import('../views/applications/Integration.vue')
      }
    ]
  },
  {
    path: '/about',
    name: 'About',
    component: () => import('../views/About.vue'),
    children: [
      {
        path: 'company',
        name: 'Company',
        component: () => import('../views/about/Company.vue')
      },
      {
        path: 'contact',
        name: 'Contact',
        component: () => import('../views/about/Contact.vue')
      },
      {
        path: 'jobs',
        name: 'Jobs',
        component: () => import('../views/about/Jobs.vue')
      }
    ]
  },
  {
    path: '/knowledge',
    name: 'Knowledge',
    component: () => import('../views/Knowledge.vue'),
    children: [
      {
        path: 'news',
        name: 'CompanyNews',
        component: () => import('../views/knowledge/News.vue')
      },
      {
        path: 'media',
        name: 'MediaReports',
        component: () => import('../views/knowledge/Media.vue')
      },
      {
        path: 'industry',
        name: 'IndustryNews',
        component: () => import('../views/knowledge/Industry.vue')
      }
    ]
  },
  {
    path: '/support',
    name: 'TechnicalSupport',
    component: () => import('../views/Support.vue'),
    children: [
      {
        path: 'training',
        name: 'Training',
        component: () => import('../views/Support.vue')
      },
      {
        path: 'maintenance',
        name: 'Maintenance',
        component: () => import('../views/Support.vue')
      },
      {
        path: 'software',
        name: 'SoftwareSupport',
        component: () => import('../views/Support.vue')
      },
      {
        path: 'docs',
        name: 'Documentation',
        component: () => import('../views/Support.vue')
      },
      {
        path: 'faq',
        name: 'FAQ',
        component: () => import('../views/Support.vue')
      }
    ]
  },
  {
    path: '/agent',
    name: 'Agent',
    component: () => import('../views/Agent.vue')
  }
]

const router = createRouter({
  history: createWebHistory(),
  routes,
  scrollBehavior() {
    return { top: 0 }
  }
})

export default router
